import React from "react";
import "./style.css";

const currencyData = [
  { label: "USD - KES", icon: "./images/image-9.png" },
  { label: "EUR - KES", icon: "./images/image16.png" },
  { label: "USD - UGX", icon: "./images/image4.png" },
  { label: "USD - TZS", icon: "./images/image19.png" },
  { label: "USD - NGN", icon: "./images/image.png" },
  { label: "USD - JPY", icon: "./images/image10.png" },
  { label: "GBP - KES", icon: "./images/image12.png" },
  { label: "USD - CNY", icon: "./images/image7.png" },
  { label: "CNY - KES", icon: "./images/image13.png" },
];

const FigmaDesign = () => {
  return (
    <div className="container">
      <div className="header">
        <span className="header-text">BUYING</span>
        <span className="header-text">SELLING</span>
      </div>
      <div className="currency-list">
        {currencyData.map((currency, index) => (
          <div key={index} className="currency-row">
            <div className="currency-label">
              <img
                className="currency-icon"
                src={currency.icon}
                alt={`${currency.label} icon`}
              />
              <span>{currency.label}</span>
            </div>
            <div className="currency-action"></div>
            <div className="currency-action"></div>
          </div>
        ))}
      </div>
    </div>
  );
};

function App() {
  return <FigmaDesign />;
}

export default App;
